import React from 'react';
import { Btn } from './Button';
import { CartProvider } from "react-use-cart";
import { useCart } from "react-use-cart";

const CartList = () => {
    const {items, totalItems, totalUniqueItems} = useCart();
    return (
        <CartProvider>
            <section className='cart-list'>
                <div className='container'>
                    <h5>
                        your cart
                    </h5>
                    <div className='light-cart-list'>
                        {items.map((item, index) => {
                            return (
                                <div className='box-light-cart-list'>
                                    <img src={ item.image } alt={ item.image } />
                                    <span>
                                        { item.name }
                                    </span>
                                    <span>
                                        01
                                    </span>
                                    <span>
                                    { item.price }
                                    </span>
                                    <Btn classbtn="main-btn-light-bc-cart-list" text="check out"/>
                                </div>
                            )
                        })}
                    </div>
                    <div className='dark-cart-list'>
                        <div className='box-dark-cart-list'>
                            <span>
                                all items
                            </span>
                            <div></div>
                            <span>
                                06
                            </span>
                            <span>
                                ({totalU})
                            </span>
                            <Btn classbtn="main-btn-dark-bc" text="check out all"/>
                        </div>
                    </div>
                </div>
            </section>
        </CartProvider>
    );
}

export default CartList;
